import React from 'react'
import useGeoLocation from "../hook/useGeoLocation";
import { Container, Row, Col } from "react-bootstrap";

const Chek = () => {

    const location = useGeoLocation();

    let lat1 = location.coordinates.lat;
    lat1 = parseFloat (lat1)
    let lng1 = location.coordinates.lng;
    lng1 = parseFloat (lng1)

    let rezult = false;
    function timeout(){
        47.2062 < lat1 < 47.20489 && 38.93943 < lng1 < 38.99016 ? rezult = true : rezult = false
    }
    console.log(rezult)
    setTimeout(timeout, 10);

    console.log(rezult)
    console.log(lat1, lng1, typeof lat1, lng1)

  return (      

    <Container>
            <Row>
                <Col md={8}>
                <div className="separator">Ваша геолокация</div>
                    <div className="row d-flex justify-content-center mt-3 mb-5 pb-5">
                <div className="col-6">
                    <div className="card">
                        <div className="card-header text-left font-weight-bold d-flex">
                            <div className="inline-block mr-auto pt-1">
                                {location.loaded
                                    ? JSON.stringify(location)
                                    : "Location data not available yet."}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
                </Col>

            </Row>
        </Container>

  )}

export default Chek
